import React,{useState} from 'react';
import './LeftHostPage.css';
import RightHostPage from './RightHostPage'

function LeftHostPage(){

    const [flat,setFlat] = useState('')
    const [bunglow,setBunglow] = useState('')
    const [rowHouse,setRowHouse] = useState('')


    const [oneRk,setoneRk] = useState('')
    const [oneBhk,setoneBhk] = useState('')
    const [twoBhk,settwoBhk] = useState('')
     const [threeBhk,setthreeBhk] = useState('')
    const [fourBhk,setfourBhk] = useState('')


    const[range,setRange]= useState('')

    const [family,setfamily] = useState('')
    const [bachelor,setbachelor] = useState('')
    const [company,setcompany] = useState('')

    
    const [full,setfull] = useState('')
    const [semi,setSemi] = useState('')
    const [none,setNone] = useState('')

      
    const [gym,setgym] = useState('')
    const [lift,setlift] = useState('')
    const [swimingpool,setswimingPool] = useState('')

      
    const [twowheeler,settwowheeler] = useState('')
    const [fourwheeler,setfourwheeler] = useState('')

    const [immediate,setImmediate] = useState('')
    const [withinweek,setwithinweek] = useState('')
    const [withintwoweek,setwithintwoweek] = useState('')


    const HostDataHandler = (event) =>{
        console.log(immediate,withintwoweek)
    }

    return(
        <form onSubmit={HostDataHandler}>
        <div className="MainHostPageContainer">
        <div className="HostPageLeftMainContainer">
            <div className="HostLeftPageCheckbox">
                <p>What type of place you want to host ?</p>
                <div>< input value={flat} type="checkbox" /><label>Flat</label></div>
                <div>< input value={bunglow} type="checkbox"/><label>Bunglow</label></div>
                <div>< input value={rowHouse} type="checkbox"/><label>Row House</label></div>
            </div>
            <div className="HostLeftPageCheckbox">
                <p>Appartment Type ?</p>
                <div>< input value={oneRk} type="checkbox"/><label>1RK</label></div>
                <div>< input value={oneBhk} type="checkbox"/><label>1BHK</label></div>
                <div>< input value={twoBhk} type="checkbox"/><label>2BHK</label></div>
                <div>< input value={threeBhk} type="checkbox"/><label>3BHK</label></div>
                <div>< input value={fourBhk} type="checkbox"/><label>4BHK</label></div>
            </div>
            <div className="HostLeftPageCheckbox">
                <p>Rent Range (per month) ?</p>
                < input value={range} type="range"/>
            </div>
            <div className="HostLeftPageCheckbox">
                <p>Preferred Tenents ?</p>
                <div>< input value={family} type="checkbox"/><label>Family</label></div>
                <div>< input value={bachelor} type="checkbox"/><label>Bachelor</label></div>
                <div>< input value={company} type="checkbox"/><label>Company</label></div>
            </div>
            <div className="HostLeftPageCheckbox">
                <p>Furnishing ?</p>
                <div>< input value={full} type="checkbox"/><label>Full</label></div>
                <div>< input value={semi} type="checkbox"/><label>Semi</label></div>
                <div>< input value={none} type="checkbox"/><label>None </label></div>
            </div>
            <div className="HostLeftPageCheckbox">
                <p>Amenities ?</p>
                <div>< input value={gym} type="checkbox"/><label>Gym</label></div>
                <div>< input value={lift} type="checkbox"/><label>Lift</label></div>
                <div>< input value={swimingpool} type="checkbox"/><label>Swming Pool</label></div>
            </div>
            <div className="HostLeftPageCheckbox">
                <p>Parking ?</p>
                <div>< input value={twowheeler} type="checkbox"/><label>2 Wheeler</label></div>
                <div>< input value={fourwheeler} type="checkbox"/><label>4 Wheeler</label></div>
            </div>
            <div className="HostLeftPageCheckbox">
                <p>Possession ?</p>
                <div>< input value={immediate} type="checkbox"/><label>Immediate</label></div>
                <div>< input value={withinweek} type="checkbox"/><label>Within a Week</label></div>
                <div>< input value={withintwoweek} type="checkbox"/><label>Within 2 Week</label></div>
            </div>
        </div>
        <RightHostPage/>
        </div>
        </form>

    );
}

export default LeftHostPage;
